import React from 'react';
import PropTypes from 'prop-types';

// app
import { Tabs, DmsTable, DmsSearch, FormLegend } from 'components';
import * as constants from 'consts';
import * as utils from 'utils';
import styles from './ClaimsUploadViewSearchDocs.styles';

// mui
import { makeStyles, Box, Grid } from '@material-ui/core';

ClaimsUploadViewSearchDocsView.propTypes = {
  tabs: PropTypes.array.isRequired,
  selectedTab: PropTypes.string.isRequired,
  isAutoSearchScreen: PropTypes.bool.isRequired,
  dms: PropTypes.shape({
    context: PropTypes.string.isRequired,
  }).isRequired,
  sourceId: PropTypes.oneOfType([PropTypes.number, PropTypes.string]),
  viewOptions: PropTypes.object.isRequired,
  referenceId: PropTypes.string.isRequired,
  viewDocumentList: PropTypes.array.isRequired,
  handlers: PropTypes.shape({
    selectTab: PropTypes.func.isRequired,
    onUnlinkorDeleteSuccess: PropTypes.func.isRequired,
  }).isRequired,
  documentTypeKey: PropTypes.oneOf(Object.values(constants.DMS_DOCUMENT_TYPE_SECTION_KEYS)),
  refData: PropTypes.object,
  isTabView: PropTypes.bool,
  isClaimsUploadDisabled: PropTypes.bool,
  isClaims: PropTypes.bool,
  isDmsDocumentMenuDisabled: PropTypes.bool,
  claimsUploadWarningMsg: PropTypes.string,
  claimsSearchDocumentsTxt: PropTypes.string,
  uploadDocumentsTitle: PropTypes.string,
};

export default function ClaimsUploadViewSearchDocsView({
  tabs,
  selectedTab,
  isAutoSearchScreen,
  dms,
  sourceId,
  viewOptions,
  referenceId,
  viewDocumentList,
  handlers,
  documentTypeKey,
  refData,
  isTabView,
  isClaimsUploadDisabled,
  isClaims,
  isDmsDocumentMenuDisabled,
  claimsUploadWarningMsg,
  claimsSearchDocumentsTxt,
  uploadDocumentsTitle,
}) {
  const classes = makeStyles(styles, { name: 'ClaimsUploadViewSearchDocs' })();

  return (
    <>
      {isTabView && (
        <>
          <Tabs tabs={tabs} value={selectedTab} onChange={(tabName) => handlers.selectTab(tabName)} />

          {selectedTab === constants.DMS_VIEW_TAB_VIEW && (
            <DmsTable
              columnsData={viewDocumentList}
              {...dms}
              sourceId={sourceId}
              canUpload={viewOptions.upload}
              canSearch={viewOptions.search}
              canUnlink={viewOptions.unlink}
              canDelete={viewOptions.delete}
              canEditMetaData={viewOptions.editMetaData}
              referenceId={referenceId}
              documentTypeKey={documentTypeKey}
              handlers={handlers}
              refData={refData}
            />
          )}
          {selectedTab === constants.DMS_VIEW_TAB_SEARCH && (
            <DmsSearch {...dms} referenceId={referenceId} isAutoSearchScreen={isAutoSearchScreen} />
          )}
        </>
      )}
      {!isTabView && (
        <>
          <Box mt={4}>
            <Grid container direction="row" justify="space-between" alignItems="center">
              <Grid item className={classes.uploadLossDocumentsTitleContainer}>
                <FormLegend text={uploadDocumentsTitle} nestedClasses={{ root: classes.uploadLossDocumentsTitle }} />
              </Grid>
            </Grid>
          </Box>
          <DmsTable
            columnsData={viewDocumentList}
            {...dms}
            sourceId={sourceId}
            canUpload={viewOptions.upload}
            canSearch={viewOptions.search}
            canUnlink={viewOptions.unlink}
            canDelete={viewOptions.delete}
            canEditMetaData={viewOptions.editMetaData}
            canMultiSelect={viewOptions.multiSelect}
            referenceId={referenceId}
            documentTypeKey={documentTypeKey}
            handlers={handlers}
            refData={refData}
            isClaims={isClaims}
            isClaimsUploadDisabled={isClaimsUploadDisabled}
            isDmsDocumentMenuDisabled={isDmsDocumentMenuDisabled}
            claimsUploadWarningMsg={claimsUploadWarningMsg}
            claimsSearchDocumentsTxt={!claimsSearchDocumentsTxt ? utils.string.t('dms.view.searchDocuments') : claimsSearchDocumentsTxt}
          />
        </>
      )}
    </>
  );
}
